    console.log(msg);
  }


    return(<div>



        <div style={{display:"flex"}}>
        <input type="text" class="msg-send-chat" onChange={(e)=>setmsg(e.target.value)}  /> 
        <div class="msg-send-btn" onClick={()=>sendMessage()}> Send</div> 
        </div>
             
    </div>);
}
